//----------------------------------------------------------------------------
double Omni_Saturation(double force)
{
	if (force<-LIMIT_FORCE)

		force = -LIMIT_FORCE;

	if (force>LIMIT_FORCE)

		force = LIMIT_FORCE;

	return force;
}



